    var geometry = turf.getGeom(nhJson);
    var scaledIslands = turf.transformScale(geometry, 10000);

    // 然后，我们使用 Turf.js 的 translate 方法来偏移南海诸岛
    const distance = 0; // 偏移距离
    const direction = 0; // 角度 0~360
    const translatedIslands = turf.transformTranslate(scaledIslands, distance, direction, {unit: 'degrees'});



    // 创建一个示例的 GeoJSON 多边形
    console.log(translatedIslands.features[0].geometry)
    const polygon = turf.multiPolygon(translatedIslands.features[0].geometry.coordinates);
    // 定义倾斜变换的参数
    const skewX = -0.08;  // x 轴上的剪切参数
    const skewY = 0;  // y 轴上的剪切参数

    // 获取多边形的坐标
    const coordinates = polygon.geometry.coordinates;

    // 创建一个倾斜变换矩阵
    const skewMatrix = math.matrix([
        [1, skewX, 0],
        [skewY, 1, 0],
        [0, 0, 1]
    ]);

    // 对每个坐标点进行倾斜变换
    const transformedCoordinates = coordinates.map(polygons => {
        return polygons.map(ring => {
            return ring.map(point => {
                const transformedPoint = math.multiply(skewMatrix, math.matrix([...point, 1]));
                return [transformedPoint.get([0]), transformedPoint.get([1])];
            });
        });
    });

    // 创建倾斜后的 GeoJSON MultiPolygon
    const skewedMultiPolygon = turf.multiPolygon(polygon);
